import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";
import { Provider } from "react-redux";
import { initReduxStore } from "./who-wants-to-be-millionaire/store/reduxStore";
import { CurrentQuestionGatewayStub } from "./who-wants-to-be-millionaire/adapters/secondary/gateways/currentQuestionRetrievalStub";

const currentQuestionGateway = new CurrentQuestionGatewayStub();
currentQuestionGateway.feedWith({
  label: "Que signifie l'acronyme TDD ?",
  answersOptions: {
    A: "Toto-Driven Development",
    B: "Test-Development Driven",
    C: "Test-Driven Development",
    D: "La réponse D",
  },
});
const store = initReduxStore({ currentQuestionGateway });

const root = ReactDOM.createRoot(
  document.getElementById("root") as HTMLElement
);

root.render(
  <React.StrictMode>
    <Provider store={store}>
      <App />
    </Provider>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
